1. Use write_todos to create a TODO at the start of the user's request, per the tool description.
2. Update the todos key in the ReActConversationState state. 
3. When you accomplish a TODO, use read_todos to read the TODOs in order to remind yourself of the plan.
4. Reflect on what you've done and the TODO.
5. Mark your task as completed, and proceed to the next TODO item.
6. Continue this process until you have completed all the TODO items created.", additional_kwargs={}, response_metadata={}, id='dff22925-6422-4ada-9dcf-988e8b2fb7c8'), HumanMessage(content="
Below is a job advertisement. Perform the following tasks in the order listed below: 
- Extract the raw context of the job advertisement.
- Extract hard and soft skills from the job advertisement.
- Validate skill results by checking for 'both' skill type.
- Extract the requirements mentioned in the advertisement.
- Extract the responsibilities mentioned in the advertisement. 
- Perform G-Eval for 'Correctness' extracted the extracted results. 

[job advertisement]
sass & bide is a highly creative Australian designer label dedicated to the strong, the obscure & the beautiful, leading the culture of fashion for bold and individualistic women.

Each collection is defined by sass & bide's dedication to women of ageless spirit connected to a sophisticated and liberating style of relaxation and adornment.

An exciting opportunity has become available for a 
Logistics Coordinator
to join the sass & bide family in our beautiful Support Office in Alexandria.

The Logistics Coordinator is responsible for the shipment and receipt of all bulk production into 3PL's and all shipments from 3PL to customer or store. This role also facilitates courier shipments to and from head office and raw material stocktakes as well as preparing regular and adhoc reporting on a variety of sass and bide logistic opportunities.

Key responsibilities include:

Organise and schedule bulk shipment through approved freight forwarder;

Follow up any shortage or discrepancy of deliveries with relevant parties including warehouse, production managers and suppliers before shipment;

Arrange transfer of stock as required for international wholesale orders;

Ensure Logistics Manager is aware of all issues which affect delivery of bulk product into store according to company critical path;

Verify, approve, and process suppliers’ invoice, checking all bulk freight, clearance and courier invoices within strict deadlines;

Assist finance department in the production suppliers account reconciliation to ensure all invoices are recorded accurately and timely;

Track and resolve any issues with freight movement between 3PL and retail stores;

Oversee the logistics admin to ensure we assist all stores with stock trace and track requirements.

Liaise with all stores to track and trace stock when required;

Organising raw materials stocktake and reporting on excess raw materials

We are seeking the following attributes:

Minimum 2 years’ experience in a similar role;

Experience with SAP or another ERP system, and previous experience with inventory management systems (experience with AP21 an advantage);

Knowledgeable and passionate about the sass and bide brand;

Good communication skills - the ability to communicate at all levels;

Intermediate excel skills and knowledge in all Microsoft Office suite/applications;

Understanding of shipping documentation & standard freight terminology;

Efficient and accurate record keeping;

You’re an able multitasker, prioritising your workload appropriately;

You’re customer centric – everything you do is with our customer in mind;

You are creative, innovative & you think differently in dealing with both opportunities and issues;

You’re a strong, clear & concise communicator;

You are organised & efficient, with a strong focus on achieving results;

Love our brand and be proud to be our key brand ambassador!

What we offer:

Opportunity to work with a highly creative Australian Designer Label;

Generous employee discount;

Career progression opportunities based on performance;

Ongoing training and development; and

Fun working environment!

Please note: due to the large volume of applications we receive, we can only respond to those who have successfully fulfilled our initial criteria. Please include a cover letter outlining your interest in working with sass and bide and how you meet the above selection criteria via the APPLY NOW option.
